import React, {useState, useEffect}  from 'react'

function Products() {
  const [products, setProducts] = useState([])

  useEffect(() => {
    fetch('/products')
    .then(response => response.json())
    .then((data) => setProducts(data) )
  },[])


  return (
    <div>
     {products.map}
    </div>
  )
}

export default Products
